import React from "react";
import '../App.css';
import $ from 'jquery';
import { Button } from "@material-ui/core";

export default function Register(){

    return(
        <div>
            <div className="reg-left-box">
                <div className="participateHead">
                    <h2>Who Can Participate?</h2>
                </div>

                <div className="participatePara">
                    <span style={{textAlign:"center"}}>Open to students of Sri Lanka <br/>Institute of Information Technology (SLIIT), <br/>Who interest in joining <br/>Mozilla Campus Club of SLIIT.</span>
                </div>
            </div>

            <div className="reg-right-box">
                <Button className="btn-grad">
                <a style={{ textDecoration: "none" }} >
                    REGISTER NOW
                    </a>
                </Button>
            </div>
            <img className="watermark" src="https://res.cloudinary.com/fitness-glory/image/upload/v1639484985/logo_icon-01_s6oex8.png"/>
        </div>
    )
}
